import StyleBase from '../components/StyleBase';
const Footer = () => {
    return (
        <styleBase>
            <section>
                <img src={require('../public/facebook.svg')} />
            </section>
        <style jsx>{`
        section {
            height: 500px;
            background: #f29a2f;
        }
        `}</style>
        </styleBase>
    )
}

export default Footer;
